/** the non-locale namespace type of the ICU Format */
export interface InnerICUFileFormat {
    /** the namespace for the translations */
    [namespace: string]: {
        /** the translation */
        [key: string]: string;
    };
}
/** the format of the temporary files */
export interface TempFileFormat {
    /** the directory that the translations were in */
    [directory: string]: InnerICUFileFormat;
}
/** ICU format - used for the translation files */
export interface ICUFormat {
    [locale: string]: {
        braze: InnerICUFileFormat;
    };
}
